ifAlias = MibTableColumn((1, 3, 6, 1, 2, 1, 31, 1, 1, 1, 18), DisplayString().subtype(subtypeSpec=ValueSizeConstraint(0,64))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: ifAlias.setDescription("This object is an 'alias' name for the interface as\n            specified by a network manager, and provides a non-volatile\n            'handle' for the interface.\n\n            On the first instantiation of an interface, the value of\n            ifAlias associated with that interface is the zero-length\n            string.  As and when a value is written into an instance of\n            ifAlias through a network management set operation, then the\n            agent must retain the supplied value in the ifAlias instance\n            associated with the same interface for as long as that\n            interface remains instantiated, including across all re-\n            initializations/reboots of the network management system,\n            including those which result in a change of the interface's\n            ifIndex value.\n\n            An example of the value which a network manager might store\n            in this object for a WAN interface is the (Telco's) circuit\n            number/identifier of the interface.\n\n            Some agents may support write-access only for interfaces\n            having particular values of ifType.  An agent which supports\n            write access to this object is required to keep the value in\n            non-volatile storage, but it may limit the length of new\n            values depending on how much storage is already occupied by\n            the current values for other interfaces.")
ifCounterDiscontinuityTime = MibTableColumn((1, 3, 6, 1, 2, 1, 31, 1, 1, 1, 19), TimeStamp()).setMaxAccess("readonly")
if mibBuilder.loadTexts: ifCounterDiscontinuityTime.setDescription("The value of sysUpTime on the most recent occasion at which\n            any one or more of this interface's counters suffered a\n            discontinuity.  The relevant counters are the specific\n            instances associated with this interface of any Counter32 or\n\n            Counter64 object contained in the ifTable or ifXTable.  If\n            no such discontinuities have occurred since the last re-\n            initialization of the local management subsystem, then this\n            object contains a zero value.")
ifStackTable = MibTable((1, 3, 6, 1, 2, 1, 31, 1, 2), )
if mibBuilder.loadTexts: ifStackTable.setDescription("The table containing information on the relationships\n            between the multiple sub-layers of network interfaces.  In\n            particular, it contains information on which sub-layers run\n            'on top of' which other sub-layers, where each sub-layer\n            corresponds to a conceptual row in the ifTable.  For\n            example, when the sub-layer with ifIndex value x runs over\n            the sub-layer with ifIndex value y, then this table\n            contains:\n\n              ifStackStatus.x.y=active\n\n            For each ifIndex value, I, which identifies an active\n            interface, there are always at least two instantiated rows\n            in this table associated with I.  For one of these rows, I\n            is the value of ifStackHigherLayer; for the other, I is the\n            value of ifStackLowerLayer.  (If I is not involved in\n            multiplexing, then these are the only two rows associated\n            with I.)\n\n            For example, two rows exist even for an interface which has\n            no others stacked on top or below it:\n\n              ifStackStatus.0.x=active\n              ifStackStatus.x.0=active ")
