if mibBuilder.loadTexts: ifStackEntry.setDescription("Information on a particular relationship between two sub-\n            layers, specifying that one sub-layer runs on 'top' of the\n            other sub-layer.  Each sub-layer corresponds to a conceptual\n            row in the ifTable.")
